import React from 'react';

const ArrivalSearchBox =(onChange)=>{
    return(
        <SearchField
            placeholder="Search..."
            onChange={onChange}
            searchText="This is initial search text"
            classNames="pa3 ba b--green bg-lightest-blue"
        />
    );  
}
export default ArrivalSearchBox;
